void save_text(GtkWidget *widget)
{
int x;
FILE *fp;

if ((fp=fopen(&longstring[0],"wb"))==NULL){errordialog("gSentinel:\nERROR:\nCannot open sentinel.conf file for writing.\nYour changes will not be saved.\n");}
/* longstring has the filename..save data with no output */
else {
for (x=0;x<gtk_text_get_length(GTK_TEXT(text))+1;x++)
{fputc(GTK_TEXT_INDEX(GTK_TEXT(text),x),fp);}
fclose(fp);}
}

void errordialog(gchar *error)
{
text_box(1,error,0,0);
}

void closedialog(GtkWidget *widget, GtkObject *object)
{
gtk_widget_destroy(widget);
lockflag=0;
}

