/* menu stuff is handled below */

static gint button_press (GtkWidget *widget, GdkEvent *event)
{
if (event->type == GDK_BUTTON_PRESS) {
GdkEventButton *bevent = (GdkEventButton *) event; 
gtk_menu_popup (GTK_MENU (widget), NULL, NULL, NULL, NULL,
                               bevent->button, bevent->time);
return TRUE; }
/* Tell calling code that we have not handled this event; pass it on. */
return FALSE;
}


/* Do something when a menu item is selected */ 
static void menuitem_response (gchar *string) 
{ 
if (strcmp(string,"Quit") == 0) 
{ g_print("Quitting normally...[Quit]\n"); gtk_main_quit (); }
else if (strcmp(string,"Directories") == 0)
{/* edit sentinel.conf */ Directories();}
else if (strcmp(string,"Rebuild database") == 0)
{/* sentinel -rebuild  */ Rebuild_database();}
else if (strcmp(string,"Add files") == 0)
{/* sentinel -addfile */ Add_files();}
else if (strcmp(string,"Delete files") == 0)
{/* sentinel -deletefile */ Delete_files();}
else if (strcmp(string,"Normal") == 0)
{/* sentinel -check */ Normal();}
else if (strcmp(string,"Slow") == 0)
{/* nice -n19 sentinel -check */ Slow();}
else if (strcmp(string,"Cloaked") == 0)
{/* sentinel -cloakcheck */ Cloaked();}
else if (strcmp(string,"Status") == 0)
{/* Check if lock file exists */ Status();}
else if (strcmp(string,"Simple view") == 0)
{/* run sentinel.batch and view with simple text file */ Simple_view();}
else if (strcmp(string,"Normal view") == 0)
{/* Normal view. */ Normal_view(); }
else if (strcmp(string,"Clear log") == 0)
{/* sentinel -wipelog */ Clear_log(); }
else if (strcmp(string,"Readme file") == 0)
{/* view readme. */ Readme_file();}
else if (strcmp(string,"About") == 0)
{/* About box */ About();}

else {g_print ("ERROR: Unknown command : %s\n", string);}
}

